import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card 
        name = {contacts[0].name}
        img = {contacts[0].imgURL}
        phone ={contacts[0].phone}
        website = {contacts[0].website}
        />

    </div>
  );
}

export default App;
